import { Col, Row, Accordion } from "react-bootstrap";
import OperatorTable from "./OperatorTable";
import ExampleGroup from "./ExampleGroup";

const EXAMPLES_1 = ["A", "~A", "~~A", "~(~~A)"];
const EXAMPLES_2 = ["A + 1", "A + 0", "A + B", "A + ~B"];
const EXAMPLES_3 = [
    "m(2, 3, 7, 9, 11, 13)",
    "m(2, 3, 7, 9, 11, 13) + d(1, 10, 15)",
    "~(A^C)@(B%D)",
];

export default function AboutAccordion(props) {
    return (
        <Accordion flush>
            <Accordion.Item eventKey="0">
                <Accordion.Header>
                    <p>
                        Operator Symbols <b>/</b> Examples <b>/</b> About
                    </p>
                </Accordion.Header>

                <Accordion.Body>
                    Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
                    eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad
                    minim veniam, quis nostrud exercitation ullamco laboris nisi ut
                    aliquip ex ea commodo consequat. Duis aute irure dolor in
                    reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla
                    pariatur. Excepteur sint occaecat cupidatat non proident, sunt in
                    culpa qui officia deserunt mollit anim id est laborum.
                    <Row>
                        <Col>
                            <OperatorTable
                                bodyClass="bg-white"
                                headClass="table-header-dark"
                            />
                        </Col>
                        <Col>
                            <ExampleGroup
                                examples={EXAMPLES_1}
                                handleExample={props.displayExpression}
                            />
                        </Col>
                        <Col>
                            <ExampleGroup
                                examples={EXAMPLES_2}
                                handleExample={props.displayExpression}
                            />
                        </Col>
                        <Col>
                            <ExampleGroup
                                examples={EXAMPLES_3}
                                handleExample={props.displayExpression}
                            />
                        </Col>
                        <Col></Col>
                    </Row>
                </Accordion.Body>
            </Accordion.Item>
        </Accordion>
    );
}
